	('fb8b3391-af6a-41bb-989a-9689da15b57b', 'Astronomy by the River', 'Join the Wenatchee Valley Astronomy Club on a family friendly journey through space. Using a variety of telescopes, well gaze up into the Milky Way and learn about some of the best night sky objects to view. 

During this program well also explore the basics of telescope use, the different types of telescopes, and some helpful tricks to enhance your experience in star gazing.', '2025-10-02', NULL, '19:30:00', '21:00:00', 'eb18d927-8c3e-41bd-a04a-2b748fc47588', 'cc1fdad6-0e8a-424a-be08-d169e1a50ab4', NULL, 'https://wenatcheeriverinstitute.org/event-calendar.html/event/2025/10/02/astronomy-along-the-river/523137', 'https://wenatcheeriverinstitute.org/event-calendar.html/event-form/registration-form/106811/tickets', '4105b94f-140c-4fc1-9137-deb9e99d5376', NULL, NULL, 'https://cdn.firespring.com/images/e11deb23-6db9-4247-88c5-ddd55f1d3431.png', false, NULL, false, true, 'Pay what you can.', 'approved', NULL, '2025-07-23 22:42:32.60417+00', '2025-07-23 22:42:32.60417+00', NULL, NULL, 'Drawing of constellations on a photorealistic night sky with the milky way present.'),
	('24477a9a-83f4-4f12-a2b3-acc94f639048', 'Sunset + S''mores', 'Come gather with us at WRI for an evening of food and s''more fun! Jump into fall with us as the evening light fades and the stars come out. Join us for a meal, drinks, and immersive activities. 

Socialize with fellow WRI supporters, board members, staff, and students. This is a family friendly event. The evening''s offerings will take place throughout WRI''s campus, both indoors and outdoors. We look forward to gathering together and celebrating our special community!', '2025-10-01', NULL, '17:00:00', '19:30:00', '4848bf9e-0ec8-49a8-9ef9-0c7c9954e903', 'cc1fdad6-0e8a-424a-be08-d169e1a50ab4', NULL, 'https://wenatcheeriverinstitute.org/event-calendar.html/event/2025/10/01/save-the-date-4th-annual-sunset-s-mores/528424', NULL, 'b93da678-d591-4abe-ab59-f38ce470bd26', '4105b94f-140c-4fc1-9137-deb9e99d5376', NULL, 'https://cdn.firespring.com/images/ff21d688-bb63-4fc6-b87d-88959c73c3a5.png', false, NULL, false, true, 'Pay what you can', 'approved', NULL, '2025-07-23 22:47:23.438334+00', '2025-07-23 22:47:23.438334+00', NULL, NULL, 'Drawing of four people sitting around a campfire next to a yellow tent alongside a meandering river with mountains in the backdrop.'),
	('2bae0a0f-7d32-4a27-b11d-122b1b7a7934', 'Red Barn Event: The Trees are Speaking', 'Join author and journalist Lynda V. Mapes for a discussion about changing our relationship with forests. 

Long regarded as commodities primarily for growing wood products, today we know forests are essential to community wellbeing, climate stability, wildlife, and clean water and air. We need to shift our relationship with forests to emphasize caretaking, respect, and reciprocity. Lynda will share examples of sustainable forestry practices underway in our region and beyond that take care of people, forests, and wildlife, drawing from her new book, The Trees Are Speaking: Dispatches from the Salmon Forests.

Doors open at 6:30pm for a community social with beer and wine available for purchase. The presentation will start at 7:00pm.

This is a partnered event with a Book for all Seasons and the Wenatchee River Institute.', '2025-09-04', NULL, '19:00:00', '20:00:00', 'eb18d927-8c3e-41bd-a04a-2b748fc47588', 'cc1fdad6-0e8a-424a-be08-d169e1a50ab4', NULL, 'https://wenatcheeriverinstitute.org/event-calendar.html/event/2025/09/04/red-barn-event-the-trees-are-speaking/528664', NULL, '4105b94f-140c-4fc1-9137-deb9e99d5376', NULL, NULL, 'https://cdn.firespring.com/images/05c93e31-39b8-4735-b0b5-5fb1db3356c3.jpg', false, NULL, false, false, NULL, 'approved', NULL, '2025-07-23 22:51:19.257205+00', '2025-07-23 22:51:19.257205+00', NULL, NULL, 'Photo of the book cover of The Trees are Speaking by Linda Mapes'),
	('2734b440-decc-4364-9833-e322bc1e961c', 'Float for Falastin', 'Paddling With A Purpose: Float the beautiful Wenatchee River to raise awareness and as a fundraiser for Gaza Soup Kitchen!

