	('d810d5a5-4528-4614-9cad-e06b85f464c7', 'Birding by the River', 'Go birding with staff from the Wenatchee River Institute at our campus by the Wenatchee River! All birding skill levels are welcome.  We have loaner binoculars that you can borrow.

