	('9b8f1944-13e0-4243-b913-f479056a8526', 'Stories in the Stars', 'WVAC member Paul Tomas will lead a night sky tour at the Leavenworth Library, offering attendees an opportunity to learn about and appreciate the celestial sphere above them. 

Through storytelling, visual aids, and guided exploration, participants will discover constellations such as the Ursa Major, Botes, Hercules, Cygnus, Cassiopeia, Delphinus, and learn techniques to trace other stars and asterisms. Paul will share star lore from cultures around the world, scientific insights, and utilize glow-in-the-dark boards to enhance visualization.

Attendees are encouraged to bring blankets or chairs, creating a relaxed environment for stargazing and learning.', '2025-09-16', NULL, '20:30:00', '21:30:00', 'c7d3bc44-b620-4109-bc58-7c69f73f4a83', '654aff2b-15cd-48ea-9b22-6910700fd53d', NULL, 'https://ncwlibraries.libcal.com/event/15071867', NULL, 'a20ee91d-6c87-46c5-92b5-869c569e6012', '4105b94f-140c-4fc1-9137-deb9e99d5376', NULL, 'https://d68g328n4ug0e.cloudfront.net/gallery/6523/stars-1837306_150.jpg', false, NULL, false, false, NULL, 'approved', NULL, '2025-09-12 16:40:14.048966+00', '2025-09-12 16:40:14.048966+00', NULL, NULL, 'Stars in the Milky Way galaxy.'),
	('96d872bf-ef8a-44d4-a931-722af7acaa24', 'Teen Library Council', 'Teens grades 8th through 12th: Are you interested in making an impact on your community?

Possible projects include working with library staff to: 
- Plan library programs for teens 
- Curate book displays
- Assist with social media 
- Write book or media reviews
- Design a literacy-based project for the greater community 

Why join? 
- To build leadership skills 
- To earn community service hours, which is beneficial for - college applications and job resumes 
- To get to know other teens and library staff in your community 
- To help make the library a better place for teens 
- To have a positive impact on our community 

Meetings are on the first Thursdays of the month from October to March (except Jan 1), with the last meeting on April 9th.

