	('51ac2143-4a12-4eac-a757-a29507f33b70', 'Reframing Menopause', 'Join us for a presentation and discussion about the shifts in medical and cultural understandings of menopause, and how we can navigate the journey with confidence!  

Hear from a medical expert and a yoga teacher about how to be empowered to embrace menopause as a new chapter of life and navigate it with confidence. We''ll debunk menopause myths, learn how to work with your medical providers to receive the care you need, and hear about how yoga and more holistic approaches rooted in other cultures can support us through our journeys.

Vanessa Weiland is a board certified Adult-Gerontology Nurse Practitioner and Menopause Society Certified Practitioner with over 10 years of experience caring for patients experiencing perimenopause, menopause, and other hormonal health concerns.

Heidi Bard is a yoga instructor who offers yoga workshops and retreats to help women manage the physical and psychological symptoms of the menopausal years and reframe menopause as a time of growth and renewal. ', '2025-10-02', NULL, '17:00:00', '19:00:00', '3ca6bebf-33b1-4265-b280-fb6dd9ebda6a', '654aff2b-15cd-48ea-9b22-6910700fd53d', NULL, 'https://ncwlibraries.libcal.com/event/15174265', NULL, 'b93da678-d591-4abe-ab59-f38ce470bd26', 'bfbbe8af-faa5-4134-961a-766a42e20a12', NULL, 'https://d68g328n4ug0e.cloudfront.net/gallery/6523/women-3051614_150.jpg', false, NULL, false, false, NULL, 'approved', NULL, '2025-09-12 17:00:02.70185+00', '2025-09-12 17:00:02.70185+00', NULL, NULL, 'Person doing a yoga-like handstand at the end of a dock surrounded by water.'),
	('429cec56-4b44-4be1-89fc-05f4f6cc632d', 'BYOB (Bring Your Own Book) After-School Club', ' Books + snacks + friends = the perfect afternoon! 

Kids in 3rd-5th grade are invited to bring a book to the library after school for snacks, 20-minutes of silent reading, and games/social activities designed to create a community of readers and support critical reading.

