	('a48a06a3-42c6-418e-b54d-36954a65db7b', 'Kristin Joy Wilks: Book Reading and Storytelling Workshop', 'Join us for a special event with local author Kristin Joy Wilks as she reads from her newest early chapter book, "Phooey Kerflooey vs. The Deep, Deep Dark!

Recommended ages: K-4th grades

Phooey Kerflooey vs. The Deep, Deep Dark
Phooey Kerflooey may be a 34-pound Newfoundland, but she is still a puppy - and she is afraid of the dark. When the power goes out at Camp Castle Pine after a night of scary stories, the world is blanketed in darkness, and Phooey is pretty sure that evil is coming for her and her boys. Will she be able to battle the Evil Electrician and fix the generator before it''s too late?

Storytelling / Acting Workshop
The reading will be followed by a short interactive storytelling workshop where kids will rewrite part of the book and act out each other''s works. Based on Vivian Gussin Paley''s approach to literacy development that honors the natural storyteller, listener, and actor in every young child.', '2025-10-23', NULL, '15:30:00', '16:30:00', '3ca6bebf-33b1-4265-b280-fb6dd9ebda6a', '654aff2b-15cd-48ea-9b22-6910700fd53d', NULL, 'https://ncwlibraries.libcal.com/event/15322967', NULL, 'a20ee91d-6c87-46c5-92b5-869c569e6012', NULL, NULL, 'https://d2jv02qf7xgjwx.cloudfront.net/accounts/404883/images/PhooeyKerflooeyvsThe-DeepDeepDark_Small.jpg', false, NULL, false, false, NULL, 'approved', NULL, '2025-09-12 17:12:37.021642+00', '2025-09-12 17:12:37.021642+00', NULL, NULL, 'Book cover showing a black dog'),
