	('e314eb56-104f-4807-a3d8-e566900c35ae', 'Volunteer Open House + Youth Training', 'Want to get more involved in your community and support outdoor education and conservation? Join us for our Volunteer Open House at Wenatchee River Institute!

From 5:00 to 6:00 PM, meet the WRI staff, connect with current volunteers, and learn about a variety of ways to give backwhether it''s helping with events, restoration projects, or lending a hand on campus. Light snacks and drinks will be provided.

If you''re interested in supporting WRIs youth programs, stay from 6:00 to 7:00 PM for our Fall Youth Program Volunteer Training. This is a great opportunity to dive deeper into volunteering with our field days and seasonal school programs.

