	('bfc55dc7-25d8-4411-a5a9-a183673797a3', 'Bead-Your-Own Lanyard Workshop with Amanda Keewatinawin', 'Join us for an evening filled with creativity and learning. Local Indigenous artist and owner of Mystic North Jewelry, Amanda Keewatinawin, will be leading a workshop on the Indigenous art form of beading. She will be sharing knowledge on the history of Indigenous beadwork and how to create your own beaded lanyard.

