	('f20e2b86-ac71-4289-a87b-158aa8a3c187', 'Outdoor Photography Workshop: Lake Wenatchee', 'Step outside and into the natural worldready to see, frame, and capture! This outdoor photo field trip will train your eye and spark your creativity. Learn how to observe your environment like a photographer, compose dynamic shots using natural light, and create a mini nature photo story. You''ll walk, explore, shoot, and reflectall in one immersive outdoor experience. 

These workshops are geared toward beginner / intermediate- level photographers, but all are welcome to enroll. Any type of capture device may be used including cell phone, point and shoot, mirrorless and DSLR cameras.

Hiking: Expect between 2 and 4 miles of walking on trails at a photographer''s pace: slow and with extended breaks!
Ages: 15 and up. Participants under 18 must attend with a registered adult.

