	('533eb690-bd05-47bc-bc42-81ee04054363', 'Make a Difference Day: WRI', 'Participating in this year''s Make a Difference Day with WRI. We will be working in the E. Lorene Young Community Garden for this year''s project.

For the last two Make a Difference Days, WRI has worked with dedicated volunteers to dismantle and replace old planter boxes and replace them with new cedar ones built onsite. Now, there are only 12 boxes left to replace, and we need your help to finish this project! These new boxes will serve community members for the next decade of fruit, vegetable, herb, and flower growing.

This is a family friendly volunteer event! WRI will have the materials and hand tools available for the work. We hope for 10 volunteers to come! The more the merrier.

RSVP appreciated but not required.', '2025-10-25', NULL, '09:00:00', '13:00:00', '4848bf9e-0ec8-49a8-9ef9-0c7c9954e903', 'cc1fdad6-0e8a-424a-be08-d169e1a50ab4', NULL, 'https://wenatcheeriverinstitute.org/event-calendar.html/event/2025/10/25/make-a-difference-day-with-wri/538306', 'https://wenatcheeriverinstitute.org/event-calendar.html/event-form/registration-form/109018/tickets', '16f2b4de-2ffd-4b1b-9b9d-ac21f298b0a5', '4105b94f-140c-4fc1-9137-deb9e99d5376', NULL, NULL, false, NULL, false, true, NULL, 'approved', NULL, '2025-09-12 17:47:20.758063+00', '2025-09-12 21:36:20.894644+00', NULL, NULL, NULL),
	('7f1db9a8-f1aa-4ae3-915f-69e9f9ce4759', 'Paint and Sip: Red Barn Style', 'Join Wenatchee River Institute and local artist and instructor Teara Dillon of Artisus for a Red Barn Paint and Sip. Art supplies, instruction, and one beverage are included in registration, and you will take home your masterpiece at the end of the night!

