	('9f8b8b37-abc5-497a-a899-3e18e91ec102', 'Red Barn Event: Fish War', 'Film viewing: When the state of Washington started arresting Indigenous tribal fishers, it was a declaration of war. Scores of legal battles culminated in a landmark Supreme Court case that was meant to put an end to the violent Fish Wars. Fifty years later, the fight for salmon continues.

The film will start at 6:00pm. After a 79 minute run time, there will be time for discussion and questions.

Produced by North Forty Productions and Northwest Treaty Tribes Media.

Have 5 minutes before this Red Barn Event? Watch the companion video, Salmon Warriors, to learn how to take action now to protect salmon. https://www.youtube.com/watch?v=8wA7AYuHSEU', '2025-10-09', NULL, '18:00:00', '20:00:00', 'eb18d927-8c3e-41bd-a04a-2b748fc47588', 'cc1fdad6-0e8a-424a-be08-d169e1a50ab4', NULL, 'https://wenatcheeriverinstitute.org/event-calendar.html/event/2025/10/09/red-barn-event-fish-war/534803', NULL, '4105b94f-140c-4fc1-9137-deb9e99d5376', 'e46ab7a2-26d1-4038-8573-e22d32c1b799', NULL, NULL, false, '5043959d-466e-4bfc-acee-faccaa6cc3f7', false, false, NULL, 'approved', NULL, '2025-09-12 17:36:35.164606+00', '2025-09-12 21:36:18.186535+00', NULL, NULL, NULL),
