	('7b5b0e0e-e5d9-46ce-95bb-26dcff50004b', 'Red Barn Event: Chimpanzees in Cle Elum?!', 'Chimpanzee Sanctuary Northwest is part retirement home, part rescue, part educational facility. Learn how this unique organization cares for chimpanzees who have been used in the pet, entertainment, and biomedical industries and how the sanctuary has grown over the last seventeen years. Learn about the plight of chimpanzees and other primates and hear stories that illustrate the big personalities, intelligence, and resiliency of the sanctuary residents. Find out from a behind-the-scenes perspective what it takes to care for chimpanzees in captivity and what the future may hold for them and others like them.', '2025-10-23', NULL, '19:00:00', '20:00:00', 'eb18d927-8c3e-41bd-a04a-2b748fc47588', 'cc1fdad6-0e8a-424a-be08-d169e1a50ab4', NULL, 'https://wenatcheeriverinstitute.org/event-calendar.html/event/2025/10/23/red-barn-event-chimpanzees-in-cle-elum-/536232', NULL, '4105b94f-140c-4fc1-9137-deb9e99d5376', NULL, NULL, 'https://cdn.firespring.com/images/9a4c32df-2546-4cac-b10c-b44e14d1ff40.png', false, '5043959d-466e-4bfc-acee-faccaa6cc3f7', false, false, NULL, 'approved', NULL, '2025-09-12 17:37:18.816602+00', '2025-09-12 21:36:16.992372+00', NULL, NULL, NULL),
	('4a4157d9-caa6-45e1-981e-eff624969fee', 'Red Barn Event: Stories from Lake Chelan', 'Join the Lake Chelan Research Institute to hear geological, environmental, and human stories from the Lake Chelan Watershed, while learning about potential threats to the lake''s ecology and opportunities to restore and steward the lake into the future. With aerial and underwater photography from Cashmere''s Steven Gnam (National Geographic, Crown of the Continent), and contributions from the Lake Chelan Research Institute''s Anna Galipeau and Phil Long, this presentation is sure to provide new perspectives on the ever-changing ecological treasure that is Lake Chelan.', '2025-11-13', NULL, '19:00:00', '20:00:00', 'eb18d927-8c3e-41bd-a04a-2b748fc47588', 'cc1fdad6-0e8a-424a-be08-d169e1a50ab4', NULL, 'https://wenatcheeriverinstitute.org/event-calendar.html/event/2025/11/13/red-barn-event-stories-from-lake-chelan/538005', NULL, '4105b94f-140c-4fc1-9137-deb9e99d5376', NULL, NULL, NULL, false, '5043959d-466e-4bfc-acee-faccaa6cc3f7', false, false, NULL, 'approved', NULL, '2025-09-12 17:37:37.984882+00', '2025-09-12 21:36:17.24479+00', NULL, NULL, NULL),
	('b6779833-8747-4e5a-9cf7-068a7a477e5d', 'Tristan und Isolde', 'The Met: Live in HD, streamed from the Metropolitan Opera in New York City to the Snowy Owl screen.After years of anticipation, a truly unmissable event arrives as the electrifying Lise Davidsen tackles one of the ultimate roles for dramatic soprano: the Irish princess Isolde in Wagners transcendent meditation on love and death. Heroic tenor Michael Spyres stars opposite Davidsen as the love-drunk Tristan. The momentous occasion also marks the advent of a new, Met-debut staging by Yuval Sharonhailed by The New York Times as the most visionary opera director of his generation and the first American to direct an opera at the famed Wagner festival in Bayreuthas well as Music Director Yannick Nzet-Sguins first time leading Tristan und Isolde at the Met. Mezzo-soprano Ekaterina Gubanova reprises her signature portrayal of Brangne, alongside bass-baritone Tomasz Konieczny, who sings Kurwenal after celebrated Met appearances in Wagners Der Fliegende Hollnder and Ring cycle. Bass-baritone Ryan Speedo Green makes an important role debut as King Marke.', '2026-03-21', NULL, '10:00:00', '13:00:00', 'fd5c956d-49c8-400a-affc-151fa31a4021', 'a5bc78aa-6d8c-4c19-8ee6-2fd507082c03', NULL, 'https://icicle.my.salesforce-sites.com/ticket/#/instances/a0FPH00000B2uRB2AZ', NULL, 'e46ab7a2-26d1-4038-8573-e22d32c1b799', NULL, NULL, 'https://icicle.org/userfiles/NO-Date-Tristan-Und-Isolde.jpg', false, '3f1ad4e0-a167-45f1-9ef9-36693e24cba9', false, true, '$15-25', 'approved', NULL, '2025-09-22 19:08:22.372038+00', '2025-09-22 19:14:37.012164+00', NULL, NULL, ''),
