	('2bd3490b-d54e-4306-a95d-d7f81f95d344', 'La Sonnambula', 'We''re making Opera fun again at the launch of our first Opera of the season, celebrating the artist Bellini with a Bellini bar and a photo booth. Free Bellini if you wear your pajamas for this slumber-inspired tale. We are excited to see you there! 


Following triumphant Met turns in Romo et Juliette, La Traviata, and Lucia di Lammermoor, Nadine Sierra summits another peak of the soprano repertoire as Amina, who sleepwalks her way into audiences hearts in Bellinis poignant tale of love lost and found. In his new production, Rolando Villaznthe tenor who has embarked on a brilliant second career as a directorretains the operas original setting in the Swiss Alps but uses its somnambulant plot to explore the emotional and psychological valleys of the mind. Tenor Xabier Anduaga returns after his acclaimed 2023 Met debut in LElisir dAmore, co-starring as Aminas fianc Elvino, alongside soprano Sydney Mancasola as her rival, Lisa, and bass Alexander Vinogradov as Count Rodolfo. Riccardo Frizza takes the podium for one of operas most ravishing works.The Met: Live in HD, streamed from the Metropolitan Opera in New York City to the Snowy Owl screen.', '2025-10-18', NULL, '10:00:00', '13:00:00', 'fd5c956d-49c8-400a-affc-151fa31a4021', 'a5bc78aa-6d8c-4c19-8ee6-2fd507082c03', NULL, 'https://icicle.my.salesforce-sites.com/ticket/#/instances/a0FPH00000B2pMg2AJ', NULL, 'e46ab7a2-26d1-4038-8573-e22d32c1b799', NULL, NULL, 'https://icicle.org/userfiles/NO-Date-La-Sonnambula.jpg', false, '3f1ad4e0-a167-45f1-9ef9-36693e24cba9', false, true, '$15-25', 'approved', NULL, '2025-09-22 19:00:12.276136+00', '2025-09-22 19:13:05.199624+00', NULL, NULL, ''),
