	('001fbd6c-6bfc-4b31-a955-6e82472afa33', 'The Welter Brothers @ Ski Hill', 'A recent graduate of Berklee college of music, Corban has a background in American roots styles and a passion for songwriting. Influenced by artists like Gordon Lightfoot, Joni Mitchell, and Townes Van Zandt, his music is informed by a life of travel and observation.

