	('16224103-d97d-4862-8fa4-759a9ddc04b4', 'Arabella', 'Strausss elegant romance brings the glamour and enchantment of 19th-century Vienna to the Met stage in a sumptuous production by legendary director Otto Schenk that is as beautiful as one could hope (The New York Times). Soprano Rachel Willis-Srensen makes her role debut as the title heroine, a young noblewoman in search of love on her own terms. Radiant soprano Louise Alder makes her Met debut as her sister, Zdenka, and bass-baritone Tomasz Konieczny is the dashing count who sweeps Arabella off her feet. The Met: Live in HD, streamed from the Metropolitan Opera in New York City to the Snowy Owl screen.', '2025-11-22', NULL, '10:00:00', '13:00:00', 'fd5c956d-49c8-400a-affc-151fa31a4021', 'a5bc78aa-6d8c-4c19-8ee6-2fd507082c03', NULL, 'https://icicle.my.salesforce-sites.com/ticket/#/instances/a0FPH00000B2tDN2AZ', NULL, 'e46ab7a2-26d1-4038-8573-e22d32c1b799', NULL, NULL, 'https://icicle.org/userfiles/NO-Date-Arabella.jpg', false, '3f1ad4e0-a167-45f1-9ef9-36693e24cba9', false, true, '$15-25', 'approved', NULL, '2025-09-22 19:08:22.372038+00', '2025-09-22 19:13:45.915244+00', NULL, NULL, ''),
	('015f1986-9a72-4960-91ef-4622e69ea058', 'Alchemy Tap Project', 'Prepare to be amazed by Alchemy Tap Project, a dynamic group that fuses rhythm and artistry! With lightning-fast footwork and contagious energy, they transform tap dance into a stunning display of sound and movement, proving that tap is pure alchemy.', '2025-09-26', NULL, '19:30:00', '21:00:00', 'fd5c956d-49c8-400a-affc-151fa31a4021', 'a5bc78aa-6d8c-4c19-8ee6-2fd507082c03', NULL, 'https://icicle.my.salesforce-sites.com/ticket/#/instances/a0FPH00000BM91V2AT', NULL, 'e46ab7a2-26d1-4038-8573-e22d32c1b799', NULL, NULL, 'https://icicle.org/userfiles/Alchemy-Tap-Project-No-Date.jpg', false, 'bc030134-c085-4bd6-a317-226d2ae10715', false, true, '$15-35', 'approved', NULL, '2025-09-22 16:57:07.275334+00', '2025-09-22 19:19:36.111654+00', NULL, NULL, NULL),
