	('4619743b-3d44-4bdd-a89a-8da6bb062a41', 'Give a Hoot Art Walk/Fun Run', 'Give a Hoot Art Walk is a vibrant, self directed arts-infused 1ish mile event on the shared campus of Icicle Creek Center for the Arts and Sleeping Lady Mountain Resort promoting physical health through joyful movement while fostering social connection, creative expression, and community pride all to benefit our arts education programming. 

Participants of all ages and abilities are invited to walk, run, dance, and play their way through a fun-filled course featuring live music, interactive art installations, and hands-on creative stations with our community partners.', '2025-10-11', NULL, '10:00:00', '13:00:00', '6e0b075a-c369-477d-8804-d09f175f7f99', 'a5bc78aa-6d8c-4c19-8ee6-2fd507082c03', NULL, 'https://icicle.my.salesforce-sites.com/ticket/#/instances/a0FPH00000BCfyj2AD', NULL, 'e46ab7a2-26d1-4038-8573-e22d32c1b799', 'a20ee91d-6c87-46c5-92b5-869c569e6012', NULL, 'https://icicle.org/userfiles/Fun-Run-Give-a-Hoot-1920x1080-Web.png', true, NULL, false, true, '$0-60', 'approved', NULL, '2025-09-22 18:54:31.543928+00', '2025-09-22 18:54:31.543928+00', NULL, NULL, 'drawing of an owl running with the words give a hoot fun run. all ages welcome.support arts education.'),
