	('5084c640-692a-4f3d-8105-0cefe04c9ff1', 'Eugene Onegin', 'Following her acclaimed 2024 company debut in Puccinis Madama Butterfly, soprano Asmik Grigorian returns to the Met as Tatiana, the lovestruck young heroine in this ardent operatic adaptation of Pushkin. Baritone Igor Golovatenko reprises his portrayal of the urbane Onegin, who realizes his affection for her all too late. The Mets evocative production, directed by Tony Awardwinner Deborah Warner, offers a beautifully detailed reading of  Tchaikovskys lyrical romance (The Telegraph). The Met: Live in HD, streamed from the Metropolitan Opera in New York City to the Snowy Owl screen.', '2026-05-02', NULL, '10:00:00', '13:00:00', 'fd5c956d-49c8-400a-affc-151fa31a4021', 'a5bc78aa-6d8c-4c19-8ee6-2fd507082c03', NULL, 'https://icicle.my.salesforce-sites.com/ticket/#/instances/a0FPH00000B2v0f2AB', NULL, 'e46ab7a2-26d1-4038-8573-e22d32c1b799', NULL, NULL, 'https://icicle.org/userfiles/NO-Date-Eugene-Onegin.jpg', false, '3f1ad4e0-a167-45f1-9ef9-36693e24cba9', false, true, '$15-25', 'approved', NULL, '2025-09-22 19:08:22.372038+00', '2025-09-22 19:14:53.115705+00', NULL, NULL, ''),
	('f5cc6f1f-ebf3-4455-95ae-319ff541a616', 'La Bohme', 'With its enchanting setting and spellbinding score, the worlds most popular opera is as timeless as it is heartbreaking. Franco Zeffirellis picture-perfect production brings 19th-century Paris to the Met stage as Puccinis young friends and lovers navigate the joy and struggle of bohemian life. Sopranos Juliana Grigoryan, Angel Blue, and Aleksandra Kurzak trade off as the feeble seamstress Mim, opposite tenors Freddie De Tommaso, Stephen Costello, Adam Smith, and Long Long as the ardent poet Rodolfo.The Met: Live in HD, streamed from the Metropolitan Opera in New York City to the Snowy Owl screen.', '2025-11-08', NULL, '10:00:00', '13:00:00', 'fd5c956d-49c8-400a-affc-151fa31a4021', 'a5bc78aa-6d8c-4c19-8ee6-2fd507082c03', NULL, 'https://icicle.my.salesforce-sites.com/ticket/#/instances/a0FPH00000B2qNr2AJ', NULL, 'e46ab7a2-26d1-4038-8573-e22d32c1b799', NULL, NULL, 'https://icicle.org/userfiles/NO-Date-La-Boheme.jpg', false, '3f1ad4e0-a167-45f1-9ef9-36693e24cba9', false, true, '$15-25', 'approved', NULL, '2025-09-22 19:08:22.372038+00', '2025-09-22 19:13:16.075175+00', NULL, NULL, ''),
	('72f321bb-c07a-4c5b-834a-b049a9c5a11d', 'El ltimo Sueo de Frida y Diego', 'American composer Gabriela Lena Frank makes her Met debut with her first opera, a magical-realist portrait of Mexicos painterly power couple Frida Kahlo and Diego Rivera, with libretto by Pulitzer Prizewinning playwright Nilo Cruz. Fashioned as a reversal of the Orpheus and Euridice myth, the story depicts Frida, sung by leading mezzo-soprano Isabel Leonard, leaving the underworld on the Day of the Dead and reuniting with Diego, portrayed by baritone Carlos lvarez. The famously feuding pair briefly relive their tumultuous love, embracing both the passion and the pain before bidding the land of the living a final farewell. Yannick Nzet-Sguin conducts the Met premiere of Franks opera, a confident, richly imagined score (The New Yorker) that bursts with color and fresh individuality (Los Angeles Times). The vibrant new production, taking enthusiastic inspiration from Frida and Diegos paintings, is directed and choreographed by Deborah Colker, following her remarkable 2024 debut staging of Ainadamar.The Met: Live in HD, streamed from the Metropolitan Opera in New York City to the Snowy Owl screen.', '2026-05-30', NULL, '10:00:00', '13:00:00', 'fd5c956d-49c8-400a-affc-151fa31a4021', 'a5bc78aa-6d8c-4c19-8ee6-2fd507082c03', NULL, 'https://icicle.my.salesforce-sites.com/ticket/#/instances/a0FPH00000B2vLd2AJ', NULL, 'e46ab7a2-26d1-4038-8573-e22d32c1b799', NULL, NULL, 'https://icicle.org/userfiles/NO-Date-Frida-Diego.jpg', false, '3f1ad4e0-a167-45f1-9ef9-36693e24cba9', false, true, '$15-25', 'approved', NULL, '2025-09-22 19:08:22.372038+00', '2025-09-22 19:15:20.180529+00', NULL, NULL, ''),
	('d2c0e728-aa3e-452c-83f6-528bb7174f60', 'Project Convergence', 'Project Convergence masterfully blends Bharatanatyam and American tap dance, delivering a captivating experience that celebrates the harmony of two rich cultures through the universal language of rhythm.', '2026-03-20', NULL, '19:30:00', '21:00:00', 'fd5c956d-49c8-400a-affc-151fa31a4021', 'a5bc78aa-6d8c-4c19-8ee6-2fd507082c03', NULL, 'https://icicle.my.salesforce-sites.com/ticket/#/instances/a0FPH00000BMIxd2AH', NULL, 'e46ab7a2-26d1-4038-8573-e22d32c1b799', NULL, NULL, 'https://icicle.org/userfiles/Project-Convergence-No-Date.jpg', false, 'bc030134-c085-4bd6-a317-226d2ae10715', false, true, '$15-35', 'approved', NULL, '2025-09-22 19:21:18.309443+00', '2025-09-22 19:33:45.426915+00', NULL, NULL, NULL),
	('ed27cfbe-3a9e-4a58-bad6-fab0f12755e5', 'Andrea Chnier', 'Giordanos passionate tragedy stars tenor Piotr Beczaa as the virtuous poet who falls victim to the intrigue and violence of the French Revolution. Following their celebrated recent partnership in Giordanos Fedora, Beczaa reunites with soprano Sonya Yoncheva as Chniers aristocratic lover, Maddalena di Coigny, with baritone Igor Golovatenko as Carlo Grard, the agent of the Reign of Terror who seals their fates. Daniele Rustioni takes the podium to lead Nicolas Jols gripping staging. The Met: Live in HD, streamed from the Metropolitan Opera in New York City to the Snowy Owl screen.', '2025-12-13', NULL, '10:00:00', '13:00:00', 'fd5c956d-49c8-400a-affc-151fa31a4021', 'a5bc78aa-6d8c-4c19-8ee6-2fd507082c03', NULL, 'https://icicle.my.salesforce-sites.com/ticket/#/instances/a0FPH00000B2tdB2AR', NULL, 'e46ab7a2-26d1-4038-8573-e22d32c1b799', NULL, NULL, 'https://icicle.org/userfiles/NO-Date-Andrea-Chenier.jpg', false, '3f1ad4e0-a167-45f1-9ef9-36693e24cba9', false, true, '$15-25', 'approved', NULL, '2025-09-22 19:08:22.372038+00', '2025-09-22 19:13:57.306835+00', NULL, NULL, ''),
	('598c7385-de41-4936-94b8-d26feff35bae', 'I Puritani', 'For gorgeous melody, spellbinding coloratura, and virtuoso vocal fireworks, I Puritani has few equals. On New Years Eve, the curtain goes up on the first new Met production of Bellinis final masterpiece in nearly 50 yearsa striking staging by Charles Edwards, who makes his company directorial debut after many successes as a set designer. The Met has assembled a world-beating quartet of stars, conducted by Marco Armiliato, for the demanding principal roles. Soprano Lisette Oropesa and tenor Lawrence Brownlee are Elvira and Arturo, brought together by love and torn apart by the political rifts of the English Civil War, with baritone Artur Ruciski as Riccardo, betrothed to Elvira against her will, and bass-baritone Christian Van Horn as Elviras sympathetic uncle, Giorgio. The Met: Live in HD, streamed from the Metropolitan Opera in New York City to the Snowy Owl screen.', '2026-01-10', NULL, '10:00:00', '13:00:00', 'fd5c956d-49c8-400a-affc-151fa31a4021', 'a5bc78aa-6d8c-4c19-8ee6-2fd507082c03', NULL, 'https://icicle.my.salesforce-sites.com/ticket/#/instances/a0FPH00000B2tzl2AB', NULL, 'e46ab7a2-26d1-4038-8573-e22d32c1b799', NULL, NULL, 'https://icicle.org/userfiles/NO-Date-I-Puritani.jpg', false, '3f1ad4e0-a167-45f1-9ef9-36693e24cba9', false, true, '$15-25', 'approved', NULL, '2025-09-22 19:08:22.372038+00', '2025-09-22 19:14:08.177646+00', NULL, NULL, ''),
