	('dd90a346-e115-4857-9c47-93cc3d4cecda', 'The Hip-Hop Orchestra Experience', 'Hip Hop Orchestra fuses classical music with hip-hop, creating a groundbreaking, high-energy sound that redefines both genres. The Hip-Hop Orchestra Experience is part concert, dance party, and club night featuring original music that samples from classical and hip-hopall presented in an underground setting like the New York scene that birthed hip-hop. Their music uniquely challenges the MCs and classical musicians, pushing the boundaries of both hip-hop and concert music, creating something completely new. The program includes seminal works of Mozart, Bach, and Beethoven, deconstructed and reimagined with funky rhythms and rapid-fire rhymes.This performance is happening in collaboration with Numerica Performing Arts Center and will be heald at their theater in Wenatchee.', '2026-03-14', NULL, '19:30:00', '21:00:00', '560e16a0-7e6e-425d-abbe-4aa06fb06c98', 'a5bc78aa-6d8c-4c19-8ee6-2fd507082c03', NULL, 'https://icicle.my.salesforce-sites.com/ticket/#/instances/a0FPH00000BM91V2AT', 'https://purchase.numericapac.org/ChooseSeats/5201', 'e46ab7a2-26d1-4038-8573-e22d32c1b799', NULL, NULL, 'https://icicle.org/userfiles/Mik-Nawooj-HipOrchestra-Numerica.jpg', false, 'bc030134-c085-4bd6-a317-226d2ae10715', false, true, '$31.50-56.50', 'approved', NULL, '2025-09-22 19:21:18.309443+00', '2025-09-22 19:30:41.960432+00', NULL, NULL, NULL),
	('daf24aca-23e1-4a31-bde5-4c612e1e5790', 'Warren Miller''s Sno-Ciety', 'Warren Millers SNO-CIETY is a celebration of the spirit of winterwherever you ride and however you connect to the snow and the community around it.

Join us for a family-friendly ski film fundraiser supporting two great community nonprofits: Plain Valley Ski Trails youth ski program, the Plain Valley Nordic Team (PVNT), and Leavenworth Winter Sports Clubs youth Nordic team (LWSC).

Be prepared to enter the raffle for great prizes that will help increase your excitement for the upcoming ski season! 

