	('0b4c9de8-2f5d-45f5-b12a-3ca1924c29c4', 'Red Barn Event: Friends of Mission Ridge', 'This event features new film "Ridge to River" created by Cashmere resident and Emmy-award winning videographer Steven Gnam. After the film, Friends of Mission Ridge (FOMR), a Wenatchee-based, grassroots non-profit, will host a Q&A session with the audience.

