	('204c5df9-33af-4603-8042-11738a7cbcde', 'Falasteen in the Valley Festival', 'Traditional Palestinian Music, Art, Dance, Poetry, food, and more. Featuring a headline performance by virtuoso Clarissa Bitar, and many other talented artists.

Line-up includes: Clarissa Bitar, Naomi Shihab Nye, Bash & Friends, Hala Saleh, Maher Joudi, Hanady Kader, Ahmad Qteifan, Waseem Sbeit, Karima Sharabi, Abde Elshafei, Intisaar Jubran, with others TBA.

Festival donations will support aid for Gaza + music education for Palestinian youth, and support of displaced Gazan musicians and their families.', '2025-10-25', NULL, '11:00:00', '19:00:00', 'fb5746e1-938a-429d-b18a-e73f5d00a17f', NULL, NULL, 'https://houseofsumoud.org/falasteen-in-the-valley-2025', 'https://www.eventbrite.com/e/house-of-sumoud-presents-falasteen-in-the-valley-tickets-1698374286209', 'e46ab7a2-26d1-4038-8573-e22d32c1b799', NULL, NULL, 'https://cdn.myportfolio.com/682006b0-46ce-455f-a1cd-c5b5d167dac4/bad729e6-4c8f-41e3-9b96-a57480d32678_rw_1920.png?h=381bf9af73249e909559f83c0207ea25', false, NULL, false, true, '$15 - $40', 'approved', NULL, '2025-09-24 23:25:33.196885+00', '2025-09-24 23:25:33.196885+00', NULL, NULL, NULL),
	('c1f00e6f-0152-478d-aaec-1ace39127919', 'Take a Kid Mountain Biking Day', 'Take A Kid Mountain Biking Day is a public community event for families that includes riding, games, food, and more! 

Participation is free and the events are open to riders of all ages and skill levels. The more, the merrier! Bring your kids, friends, your kids'' friends, and anyone who wants to get out on the trails for a fun day of mountain biking. 

Bring helmet, bike, snacks or cash to buy food/drinks. Limited numbers of extra bikes and helmets also available.

