	('692e4e95-df31-466e-a23f-17cf5f0164bc', 'Community Meeting with Commissioner Smith', 'Community Meeting with County Commissioner Shon Smith, District 2.

Joining commissioners will be department directors from Community Development, Public Works, Economic Services, Natural Resources and the County Administrator''s Office.

Much of the fall meetings will be focused on the Chelan-Douglas Regional Port Authority''s attempts to put in a tax increment financing area in Malaga -- and the impacts on the county as well as other taxing districts. The commissioners have spoken out against the TIA and its negative impacts on our community. They have called upon the regional port to publicly withdraw its TIA proposal, begin a year-long community outreach process and determine a reasonable pathway forward on any future TIAs that do not harm other taxing districts.

Come learn about the TIA, bring your questions and talk to a commissioner or department director about what''s on your mind.', '2025-10-16', NULL, '18:00:00', '20:00:00', 'c800b870-684b-4d44-afdd-1a0326b4ae8a', NULL, NULL, 'https://www.co.chelan.wa.us/news/article/join-us-for-fall-community-meetings', NULL, '16f2b4de-2ffd-4b1b-9b9d-ac21f298b0a5', NULL, NULL, NULL, false, NULL, false, false, NULL, 'approved', NULL, '2025-10-14 16:47:36.968479+00', '2025-10-14 16:47:36.968479+00', NULL, NULL, NULL),
