	('1ecaa7a5-fe53-4926-9fc5-bc1fa85602e2', 'Ecstatic Dance', 'Community contact jam & ecstatic dance.

10:00 11:00 AM  Contact Jam (optional)
Open to all levels, no experience necessary. Well begin with a 30-minute introduction offering some instruction in the form, then move into a free-form jam. Contact Improv is partner dancing improvisationally  a practice of attunement, listening, and safe, consensual touch. It explores weight sharing, connection, and movement together. 

11:00 AM1:00 PM  Ecstatic Dance
We begin with an opening circle to co-create a safe container for everyone to move freely. The dance takes participants on a journey with music carefully curated to guide expression, and we end with a closing circle to share and connect if desired. Free-form dance invites your body, emotion, and expression to move freely. Play, explore, and connect. Come as you are  dance like no one is watching! Its not about how you look, but how you feel.', '2025-11-09', NULL, '10:00:00', '13:00:00', '06534828-ce3b-430e-a56e-33c0ef903bf6', NULL, NULL, 'https://icicle.my.salesforce-sites.com/ticket/#/instances/a0FPH00000CLeGT2A1', 'https://icicle.my.salesforce-sites.com/ticket/#/instances/a0FPH00000CLeGT2A1', 'e46ab7a2-26d1-4038-8573-e22d32c1b799', NULL, NULL, 'https://icicle.org/userfiles/v2-Nov9-Ecstatic-Dance-Presentation.jpg', false, NULL, false, true, '$15-25 sliding scale', 'approved', NULL, '2025-10-20 19:49:59.739301+00', '2025-10-20 19:49:59.739301+00', NULL, NULL, NULL),
