	('6efe47a5-edbe-44e8-8355-c205ccfc682e', 'Bakke Cup 2026', 'Getting kids out on the snow and having fun is the idea behind the day - we want kids to leave with good memories and lots of smiles.

All children are welcome to participate and all proceeds will benefit the LWSC Ski Teams.  The event is open to any youth ages 6 through 17.   The Bakke Cup is a 3-way race. GS and Jump results determine the start order of the Nordic race, which determines the overall finish results. 

Checkin/ Bib pick up: 8:00am - 8:50am- Check in/Bib Pickup

Alpine Race: 9:30 - First racer starts (Warm up/course slip only (no racing) - 8:45-9:30am). 
Ski Jump Competition: Following completion of your age category you move to the jump for the Jump pursuit
