	('65b2719e-6d19-41b6-80a2-386e8ab65368', 'Santa Claus Conquers the Martians', 'A Family Christmas Extravaganza!

Is Santa truly lost to the Red Planet?
Will Christmas be saved, or will it be a Martian mess?
Join us for an uproarious, out-of-this-world holiday comedy based on the cult-classic 1964 B-movie! Watch as Santa gets kidnapped by mischievous Martians, threatening to leave children all over Earth without toys. Can Christmas be saved?

This one-of-a-kind stage adaptation brims with off-the-walls humor, retro charm, and heartwarming holiday spirit. Directed by Erik Furuheim, whos eager to share this long-standing Christmas tradition from his South California home theater. The show features a talented cast of local and Seattle-based actors, improvisers, and plenty of surprises! Expect quirky, zany antics, retro-inspired sound and visuals, and a performance style reminiscent of Saturday Night Live. Get ready for a joyful, unpredictable ride where anything can happen!

Dont miss a first for Leavenworth! Whether you''re a fan of cheesy B-movies, looking for a non-traditional Christmas celebration, or just need a good laugh, this show has something for everyone. The critics call it the worst movie ever made, but how much worse could the stage version be?

The only way to find out is to join the fun!
Come for the laughs, stay for the holiday cheer, and make this Christmas unforgettable! 

Suitable for ages 5 and up. The lobby opens at 1:30pm, and the play starts at 2:00pm. ', '2025-12-06', NULL, '14:00:00', '15:30:00', '06534828-ce3b-430e-a56e-33c0ef903bf6', 'a5bc78aa-6d8c-4c19-8ee6-2fd507082c03', NULL, 'https://icicle.my.salesforce-sites.com/ticket/#/events/a0SPH00000BAAvp2AH', 'https://icicle.my.salesforce-sites.com/ticket/#/instances/a0FPH00000C3ijx2AB', 'e46ab7a2-26d1-4038-8573-e22d32c1b799', 'a20ee91d-6c87-46c5-92b5-869c569e6012', NULL, 'https://icicle.org/userfiles/Martains2-No-Date-1.jpg', false, '45bc6a12-80c6-4275-abf2-4d9232de9917', false, true, '$20-35', 'approved', NULL, '2025-10-20 20:01:47.211279+00', '2025-10-20 20:08:04.929719+00', NULL, NULL, NULL),
