	('423d2c84-77bb-4f51-a742-4ee8cdee18d7', 'Illuminate the Night', 'Fourth annual solstice gatheringan evening of warmth, wonder, and heart-centered community.

6:00pm | Doors Open
6:307:45 | Opening Performances: Heart-centered sets from Benjamin Jay Thomas, A Hundred Miles, Nora Heath, Terry Pooler and more.
8:009:15 | Shine Song Collective: Guided-concert experience with songs, poems, and moments of communal singing.
9:1510:15 | Ecstatic Dance: Dance journey curated by DJ Klarity, accessible and welcoming for all.
10:1511:00 | Closing Circle of Song: Intimate, gentle singing and shared music to send us into the solstice night.

Please join us for as much of the evening as you would like. We look forward to sharing this time together with you in community celebration. 

On the longest night of the year, we gather to honor the turning of the seasons with an immersive evening of music, movement, and connection.

 

This years gathering expands into a multi-hour journey featuring music from Shine Song Collective, Benjamin Jay Thomas, A Hundred Miles, Nora Heath, Terry Pooler, and more. The night will flow into an ecstatic dance with DJ Klarity and conclude with an intimate circle of song cozy voices lifting together as we welcome the solstice night.

 Seating will be a mixed arrangement of floor seating with back jacks and cushions, plus an outer ring of chairs for accessibility and comfort.

