	('9e32d02b-409c-444e-8e9d-5ea2264f3663', 'The Sugarplums Candy Cane Christmas', 'The Sugarplums are the winners of the Christmas Caroler Challenge, a national singing competition on The CW! The Sugarplums have captivated audiences nationwide with their charming choreography, engaging interaction, and harmonies so sweet they may give you a toothache! Their performances feature all of your holiday music favorites, ranging from beloved classics like White Christmas as performed by The Drifters, to upbeat and lively renditions like Jingle Bells as performed by The Puppini Sisters and Michael Bubl.', '2025-12-06', NULL, '19:30:00', '21:30:00', 'ac79938c-a411-4c99-84a5-a25573172bb1', NULL, NULL, 'https://oktoberfestchristmastown.seetickets.com/event/the-sugarplums-candy-cane-christmas-concert/festhalle-auditorium-1001-front-st-/3507322', NULL, 'e46ab7a2-26d1-4038-8573-e22d32c1b799', NULL, NULL, 'https://c.ststat.net/content/entimg/tour/312b3a24-3673-4672-81ae-9e2a73030a38.jpg', false, '47a5d05e-8202-4028-a60b-cd3af006e7d4', false, true, '$12.49 - $17.82', 'approved', NULL, '2025-10-20 20:34:44.064809+00', '2025-10-20 20:34:44.064809+00', NULL, NULL, NULL),
	('26efb8c2-f7c1-489d-89b9-df0034264b71', 'THE JEWEL TONES Motown Christmas Show', 'The Jewel Tones are an all-female, Motown-inspired vocal trio who perform hits by The Supremes, The Jackson 5, Gladys Knight & The Pips, Stevie Wonder and many more. These ladies deliver sparkling personality, stellar vocals, fun choreography, and a classic 1960s look. They are a sparkling homage to the music of Motown, the definitive era of American artistry and soul.', '2025-12-13', NULL, '19:30:00', '21:30:00', 'ac79938c-a411-4c99-84a5-a25573172bb1', NULL, NULL, 'https://oktoberfestchristmastown.seetickets.com/event/the-jewel-tones-motown-christmas-show/festhalle-auditorium-1001-front-st-/3503781', NULL, 'e46ab7a2-26d1-4038-8573-e22d32c1b799', NULL, NULL, 'https://c.ststat.net/content/entimg/tour/b6f9a54d-ec3d-43e5-8c9b-6f8b6c097a30.jpg', false, '47a5d05e-8202-4028-a60b-cd3af006e7d4', false, true, '$12.49 - $17.82', 'approved', NULL, '2025-10-20 20:38:07.037916+00', '2025-10-20 20:38:07.037916+00', NULL, NULL, NULL),
