	('81a4ed8c-1cb0-463b-96d8-5a71d5f22f63', 'LWSC Community Night', 'The Leavenworth Winter Sports Club is hosting an Open Community Night to connect with members and the broader community. This is an opportunity to hear updates on our winter preparation, and listen to your ideas about how LWSC can continue building community through outdoor recreation. Your voices help shape the future of our nearly 100-year-old organization. Everyone is welcome to join the conversation and stay involved in whats ahead.', '2025-11-10', NULL, '18:00:00', '20:00:00', '8d8163ad-736c-4ab9-96ef-a3d50a0e8858', '2e6993f7-4dc9-458b-a81f-2f2eab6c15dd', NULL, NULL, NULL, '96a5a760-6320-4254-9254-d8bfc892a001', 'b93da678-d591-4abe-ab59-f38ce470bd26', NULL, NULL, false, NULL, false, false, NULL, 'approved', NULL, '2025-11-07 18:43:49.486458+00', '2025-11-07 18:43:49.486458+00', NULL, NULL, NULL),
